    private void formWindowActivated(java.awt.event.WindowEvent evt) {//GEN-FIRST:event_formWindowActivated

        int x;
        for(x = 0; x <= 365; x++){
            jComboBox1.addItem(x + "\n");
        }
        
        for(x = 0; x <= 50; x = x+5){
            jComboBox4.addItem(x + "%" + "\n");
        }
        
        for(x = 0; x <= 50; x++){
            jComboBox3.addItem(x + "\n");
        }
        
        for(x = 2019; x<2050; x++){
            jComboBox19.addItem(x + "\n");
            jComboBox20.addItem(x + "\n");
            jComboBox21.addItem(x + "\n");
            jComboBox22.addItem(x + "\n");
            jComboBox23.addItem(x + "\n");
        }
        
        for(x = 1; x<=31; x++){
            jComboBox9.addItem(x + "\n");
            jComboBox10.addItem(x + "\n");
            jComboBox11.addItem(x + "\n");
            jComboBox12.addItem(x + "\n");
            jComboBox13.addItem(x + "\n");
        }
        
        for(x = 1; x<=12; x++){
            if(x >= 10){
                jComboBox14.addItem(x + "\n");
                jComboBox15.addItem(x + "\n");
                jComboBox16.addItem(x + "\n");
                jComboBox17.addItem(x + "\n");
                jComboBox18.addItem(x + "\n");
            }else{
                jComboBox14.addItem("0" + x + "\n");
                jComboBox15.addItem("0" + x + "\n");
                jComboBox16.addItem("0" + x + "\n");
                jComboBox17.addItem("0" + x + "\n");
                jComboBox18.addItem("0" + x + "\n");
            }
            
        }
        
        
    }//GEN-LAST:event_formWindowActivated

