    private void jButton1ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jButton1ActionPerformed
        
        double Discount, SubTotal, Tax, Total;
        double CostPerDay = Double.parseDouble(jLabel25.getText());
        double SetDueDay = Double.parseDouble(jTextField3.getText());
        
        Object NoSelected = jComboBox1.getSelectedItem();
        
        String NoOfDay = NoSelected.toString();
        double daySelected = Double.parseDouble(NoOfDay);
        Discount = ((CostPerDay * SetDueDay) * daySelected) / 100;
        
        SubTotal = ((CostPerDay * SetDueDay) + Discount);
        Tax = SubTotal * 0.12;
        Total = (Tax + SubTotal);
        
        String iSubT = String.format("php %.2f", SubTotal);
        jLabel22.setText(iSubT);
        
        String iTax = String.format("php %.2f", Tax);
        jLabel21.setText(iTax);
        
        String iTotal = String.format("php %.2f", Total);
        jLabel23.setText(iTotal);
        
          
    }//GEN-LAST:event_jButton1ActionPerformed

